import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-image: linear-gradient(
      62deg,
      rgba(1, 95, 183, 0.9732216701223994) 13%,
      rgba(255, 122, 151, 0.5) 4%
    ),
    linear-gradient(
      44deg,
      rgba(0, 43, 99, 0.07922090238615942) 39%,
      rgba(242, 140, 143, 0.5) 18%
    ),
    linear-gradient(
      118deg,
      rgba(84, 202, 242, 0.03152997265339608) 40%,
      rgba(247, 155, 187, 0.5) 54%
    ),
    linear-gradient(
      58deg,
      rgba(90, 90, 237, 0.16144443572260592) 83%,
      rgba(249, 156, 142, 0.5) 23%
    );
  background-blend-mode: normal, lighten, multiply, hard-light;
  overflow: hidden;
`;
const ListBox = styled.div`
  width: 40%;
  padding: 1rem 2rem;
  color: white;
  background-color: #10101d;
  border-radius: 8px;
`;
const TextInput = styled.input`
  background-color: #10101d;
`;

const Home = () => {
  console.log("00");
  return (
    <Container>
      <ListBox>
        <h1>TO DO LIST</h1>

        <TextInput placeholder="Add New Task" />
      </ListBox>
    </Container>
  );
};

export default Home;
